"""# สร้างตามขนาด
ตัวรับ = np.ndarray(tuple เก็บขนาด, ชนิดข้อมูลที่จะให้เก็บ)
"""

C = np.ndarray((2, 3))
D = np.ndarray((2, 3), int)
print(C)
print("-----------------------")
print(D)

"""# สร้างตามขนาดและกำหนดให้ทุกตัวเป็น 0 หรือ 1
ตัวรับ = np.zeros(tuple เก็บขนาด, ชนิดข้อมูลที่จะให้เก็บ)\
ตัวรับ = np.ones(tuple เก็บขนาด, ชนิดข้อมูลที่จะให้เก็บ)
"""

