"""# นับจำนวน X ในอาเรย์
x เป็นอะไรก็ได้ที่เป็นค่าคงที่ \
ใช้คำสั่ง Array.sum(X)
"""

def count_odd(A):
    return A.sum(A%2 == 1)

def get_odd(A):
    return A[A.sum(A%2 == 1)]

def get_odd_positon(A):
    pos = np.arange(A.shape[0])
    return pos[A%2 == 1]

Arr = np.arange(1, 11)

