"""# Element-wise operations"""

x = [1, 2, 3]
y = [4, 5, 6]
u = np.array([1, 2, 3])
v = np.array([4, 5, 6])

print("type of x, y =", type(x), type(y))
print("type of u, v =", type(u), type(v))

print("x + y =", x + y)
