print(B)

"""# Logical operators

ไม่สามารถใช้ [] and [], [] or [], not [] ต้องใช้เครื่องหมาย ~ | & เทียบตัวต่อตัวเท่านั้น

```
[True True False False] & [False True True False]
[True True False False] | [False True True False]
~ [False True True False]
```
"""

A = np.array([9, 3, 0, 2, 6])
B = A[(A > 2) & (A < 5)]
C = A[A > 2] & A[A < 5] # [9, 3, 6] & [3, 0, 2]

print(A[A > 2] ) # [1001, 0010, 0110] & 
print(A[A < 5] ) # [0011, 0000, 0010]

print("B = ", B); print("C  =", C);

"""สังเกตว่า C คือเอาสมาชิกในแต่ละตัวละเทียบเลขฐาน 2 กัน

# Matrix translation
"""

P1xy = np.array([[-7, 2], [-5, 7], [-1, 0]])
T = np.array([ [[7, -3]] * P1xy.shape[0] ]) # [[7, -3]] * P1xy.shape[0]
P2xy = P1xy + T

print(P1xy); 
print("-----------------------------")
print(T); 
print("-----------------------------")
print(P2xy)

"""# Broadcasting

เมื่อนำอาเรย์มาทำ element wise แต่ทั้งสองมีขนาดไม่เท่ากัน

โปรแกรมจะปรับให้เข้ากัน โดยที่\
เขียนมิติ ในรูป (tuple) เทียบขนาดหากมีเท่าจะปรับอีกตัว
"""

A1 = np.array([2, 3])
B1 = np.array([[1, 2], [3, 4], [5, 6]])

print(A1 + B1)

"""Matrix translation ใช้แบบนี้แก้ได้"""

P1xy = np.array([[-7, 2], [-5, 7], [-1, 0]])
T = np.array([[7, -3]]) 
P2xy = P1xy + T

