"""# ฟังก์ชันที่น่าสนใจ
np.sum --> หาผลรวม\
np.max --> หาค่ามากที่สุด\
np.argmax --> หาตำแหน่ง max\
np.min --> หาค่าน้อยที่สุด\
np.argmin --> หาตำแหน่ง min\
np.mean --> หาค่าเฉลี่ย\
np.std ---> หาส่วนเบี่ยงเบนมาตรฐาน\
np.dot --> เหมือน dot ในคณิตศาสตร์
"""

A = np.array([range(1, 6), range(10, 5, -1), range(11, 16), range(20, 15, -1)])

print(A)

print(np.sum(A, axis = 0))
print(np.sum(A, axis = 1))

print(np.min(A, axis = 0))
print(np.min(A, axis = 1))

print(np.max(A, axis = 0))
print(np.max(A, axis = 1))

"""# ค่าเฉลี่ย ค่า SD
np.mean(อาเรย์, axis = x) x = 1 แนวนอน, x = 0 แนวตั้ง, ถ้าไม่ใส่คือเอาทั้งหมด\
np.std(อาเรย์, axis = x) x = 1 แนวนอน, x = 0 แนวตั้ง, ถ้าไม่ใส่คือเอาทั้งหมด
"""

print(np.mean(A))

print(np.std(A))

"""# Dot Product
np.dot(vector, vector) --> vector or Array 1D เหมือนในคณิตศาสตร์\
np.dot(vector, matrix) --> เหมือนในคณิตศาสตร์ มีเรื่อง Boardcasting ช่วย \
np.dot(matrix, matrix) --> คูณเมตริกซ์ตามปกติ
"""

V1 = np.array([1 ,2 , 3])
V2 = np.array([4 ,5 , 6])
V  = np.dot(V1, V2)

print(V)

V1 = np.array([1 ,2 , 3])
M1 = np.array([[4, 7], [5, 8], [6, 9]])
Result = np.dot(V1, M1)

print(Result)

M1 = np.array([[1, 2, 3] ,[4, 5, 6]])
M2 = np.array([[7, 8], [9, 10], [11, 12]])
Result = np.dot(M1, M2)

print(Result)

"""np.xxx(a ,b) ได้ผลเหมือน a.xxx(b)\
แต่ np.xxx(a, b) --> a, b เป็น list ได้ \
a.xxx(b) --> a, b ต้อง Numpy เท่านั้น
"""

print(np.dot(M1, M2))
print("--------------------------")
print(M1.dot(M2))

